Reklamę tej gry zobaczyłam podczas przeglądania story na Instagramie, byłam przekonana, że jest to kolejna gra mobilna 🤔 Jakie było moje zdziwnienie kiedy zobaczyłam, że jej demo jest dostępne na Steam 😱😱😱 Raji: An Ancient Epic to przygodowa gra akcji osadzona w starożytnych Indiach. Demo urzekło mnie swoim wyglądem, a także cudowną muzyką. W Raji: An Ancient Epic będzie można zagrać na PC, Xbox One, PS4 oraz Nintendo Switch. Premiera jest przewidziana na początek 2020 roku! 😁

